import React from "react";
import { headerTabs } from "src/constants/general";

const Header = () => {
  return (
    <aside className="flex items-center justify-between gap-10 px-7 py-6 w-full text-2xl tracking-widest font-bold">
      <a href="/">KAIXIN </a>
      <article className="flex items-center gap-20">
        {headerTabs.map((tab) => {
          return (
            <a href={tab.link} className="uppercase">
              {tab.name}
            </a>
          );
        })}
      </article>
      <article className="flex items-center gap-5">
        <a
          href="https://github.com/kaixin1528"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img src="/github.png" alt="github" className="w-10 h-10" />
        </a>
        <a href="/" target="_blank" rel="noopener noreferrer">
          <img src="/linkedin.png" alt="linkedin" className="w-10 h-10" />
        </a>
      </article>
    </aside>
  );
};

export default Header;
